<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>Contrairement aux langages artificiels tels que les langages de programmation et les notations mathématiques, les langages naturels ont évolué au fur et à mesure qu'ils passent de génération en génération et sont difficiles à cerner avec des règles explicites. Le <b>traitement du langage naturel</b> NLP (Natural Language Processing) fournit une manipulation informatique du langage naturel. Cela pourrait être de compter la fréquence des mots pour comparer différents styles d'écriture ou de comprendre des énoncés humains complets jusqu'à pouvoir leur donner des réponses utiles. Les technologies basées sur le NLP sont de plus en plus répandues. Par exemple, les téléphones et les ordinateurs portables prennent en charge la reconnaissance prédictive du texte et de l'écriture manuscrite; les moteurs de recherche Web donnent accès à des informations enfermées dans des textes non structurés; la traduction automatique nous permet de récupérer des textes écrits en chinois et de les lire en espagnol. En offrant des interfaces homme machine plus naturelles et un accès plus sophistiqué aux informations stockées, le traitement du langage en est venu à jouer un rôle central dans la société de l'information multilingue.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
