<h1 class="Section4">
<a class="Section5" href="#" id="l-interpreteur-python">L'interpréteur Python</a>
</h1>
<div class="Section6"><br>L'un des avantages de Python est qu'il vous permet de taper directement dans l'interpréteur interactif, le programme qui exécutera vos programmes Python.<br><br>L'invite (&gt;&gt;&gt;) indique que l'interpréteur Python attend maintenant une entrée.<br><br>Considérons l'extrait de code suivant qui calcule une expression arithmétique:<br><br><pre class="GCode1 Code1 AceCode" data-mode="python" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
&gt;&gt;&gt; 1 + 5 * 2 - 3
8
&gt;&gt;&gt;
#================================================</pre><br>Une fois que l'interprète a fini de calculer la réponse et de l'afficher, l'invite (&gt;&gt;&gt;) réapparaît. Cela signifie que l'interpréteur Python attend une autre instruction.<br><br>Considérons l'extrait de code suivant qui affiche la sortie de l'interpréteur en cas d'erreur:<br><br><pre class="GCode1 Code1 AceCode" data-mode="python" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
&gt;&gt;&gt; 1 +
File "&lt;stdin&gt;", line 1
1 +
^
SyntaxError: invalid syntax
&gt;&gt;&gt;
#================================================</pre><br>Considérons l'extrait de code suivant qui télécharge la collection de livres NLTK:<br><br><pre class="GCode1 Code1 AceCode" data-mode="python" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
&gt;&gt;&gt; import nltk
&gt;&gt;&gt; nltk.download()
#================================================</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Le module livre contient une collection de textes NLTK.<br><br>Considérons l'extrait de code suivant qui importe une collection de textes NLTK:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="python" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
&gt;&gt;&gt; from nltk.book import *
#================================================
*** Introductory Examples for the NLTK Book ***
Loading text1, ..., text9 and sent1, ..., sent9
Type the name of the text or sentence to view it.
Type: 'texts()' or 'sents()' to list the materials.
text1: Moby Dick by Herman Melville 1851
text2: Sense and Sensibility by Jane Austen 1811
text3: The Book of Genesis
text4: Inaugural Address Corpus
text5: Chat Corpus
text6: Monty Python and the Holy Grail
text7: Wall Street Journal
text8: Personals Corpus
text9: The Man Who Was Thursday by G . K . Chesterton 1908
#================================================</pre><br>Chaque fois que nous voulons en savoir plus sur ces textes, il nous suffit d'entrer leurs noms à l'invite Python.<br><br>Considérons l'extrait de code suivant qui affiche le contenu d' texte NLTK:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="python" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
&gt;&gt;&gt; text1
&lt;Text: Moby Dick by Herman Melville 1851&gt;
&gt;&gt;&gt; text2
&lt;Text: Sense and Sensibility by Jane Austen 1811&gt;
&gt;&gt;&gt;
#================================================</pre><br></div>
